import React from 'react';
import './style.css';
import Navbar from './Navbar';
import Footer from './Footer';
import {Button} from '@material-ui/core';
import { Link } from 'react-router-dom';
import logo from './images/logo2.png';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';

const useStylesReddit = makeStyles((theme) => ({
  root: {
    border: '1px solid #e2e2e1',
    overflow: 'hidden',
    borderRadius: 4,
    backgroundColor: '#fcfcfb',
    transition: theme.transitions.create(['border-color', 'box-shadow']),
    '&:hover': {
      backgroundColor: '#fff',
    },
    '&$focused': {
      backgroundColor: '#fff',
      boxShadow: `${fade(theme.palette.primary.main, 0.25)} 0 0 0 2px`,
      borderColor: theme.palette.primary.main,
    },
  },
  focused: {},
}));

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '20rem',
      borderColor: '#EF4F23',
    },
  },
}));

const theme = createMuiTheme({
  palette: {
    primary: green,
  },
});

const Sign_in = () => {
    
  const classes = useStyles();

  return (
    
    <div className="container1">
      <Navbar />
        <h2>Sign into CoralOS</h2>
        <p>Continue with the Google account or email address you use to sign in.</p>
        <Link to='/add_phone_number'  className="link1">
          <Button className="button1" variant="outlined" ><img src={logo} /><span> &nbsp;Continue with Google</span></Button>
        </Link>
        <div className="Text1"><span>or</span></div>
        <form className={classes.root} noValidate autoComplete="off">
            <TextField id="mui-theme-provider-outlined-input" placeholder="Email Address" variant="outlined" size="small"/>
        
        </form>
        <form className={classes.root} noValidate autoComplete="off">
            <TextField id="outlined-basic" placeholder="Password" variant="outlined" size="small"/>
        </form>
      
        <div className="checkbox1">
          <input type='checkbox' />
          <label>Remember me</label>
        </div>
        <Link to='/home'  className="link1"><Button className="button2">Sign in</Button></Link>
        <div className="linkdiv1">
            <Link to='/Sign_up'  className="link1">Forgot your password ?</Link>
            <br/>
            <Link to="/Sign_up" className="link2">Create an account</Link>
        </div>
        <Footer/>
    </div>
  );
};

export default Sign_in;
